INSERT INTO `DDMTemplate` VALUES ('548dee8d-127b-c2ee-d91a-77e0ab604bc3',32112,20152,20116,20120,NULL,20120,NULL,'2018-04-02 18:23:59.302000','2018-04-02 18:23:59.302000',32110,0,32111,'BREADCRUMB-ARROWS-FTL','1.0','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,zh_CN,es_ES,ja_JP,nl_NL,hu_HU,pt_BR,de_DE,iw_IL,fi_FI,ca_ES,fr_FR,\" default-locale=\"en_US\"><Name language-id=\"zh_CN\">箭头</Name><Name language-id=\"es_ES\">Flechas</Name><Name language-id=\"ja_JP\">矢印</Name><Name language-id=\"nl_NL\">Pijltjes</Name><Name language-id=\"hu_HU\">Nyilak</Name><Name language-id=\"pt_BR\">Setas</Name><Name language-id=\"de_DE\">Pfeile</Name><Name language-id=\"iw_IL\">חיצים</Name><Name language-id=\"fi_FI\">Nuolet</Name><Name language-id=\"ca_ES\">Fletxes</Name><Name language-id=\"fr_FR\">Flèches</Name><Name language-id=\"en_US\">Arrows</Name></root>','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,zh_CN,es_ES,ja_JP,nl_NL,hu_HU,pt_BR,de_DE,iw_IL,fi_FI,ca_ES,fr_FR,\" default-locale=\"en_US\"><Description language-id=\"zh_CN\">标题和链接的箭头代表了显示在路径导航里的每个元素。</Description><Description language-id=\"es_ES\">Muestra el camino de navegación en la que todo elemento de navegación es representado por una flecha con su título y enlace.</Description><Description language-id=\"ja_JP\">矢印についているタイトルとリンクに表される、それぞれのナビゲーション要素のぱんくずリストを表示します。</Description><Description language-id=\"nl_NL\">Toont een klikpad waarin elke navigatie-element wordt weergegeven door een pijltje met de titel en de link.</Description><Description language-id=\"hu_HU\">Egy útvonalat jelenít meg, amelyben minden navigációs elemet egy nyíl képvisel a címkéjével és a linkkel együtt.</Description><Description language-id=\"pt_BR\">Exibe o caminho de navegação no qual todo elemento de navegação é representado por uma seta com seu título e link.</Description><Description language-id=\"de_DE\">Stellt eine Breadcrumbnavigation dar, in der jedes Navigationselement als Pfeil mit Titel und Link angezeigt wird.</Description><Description language-id=\"iw_IL\">מציג פירור לחם שבו כל רכיב ניווט מיוצג על ידי חץ עם הכותר שלו וקישור.</Description><Description language-id=\"fi_FI\">Näyttää murupolun, missä jokainen navigaatio elementti näytetään nuolella otsikon kanssa ja linkillä.</Description><Description language-id=\"ca_ES\">Mostra una ruta de navegació en què cada element de navegació està representat per una fletxa amb el seu títol i enllaç.</Description><Description language-id=\"fr_FR\">Affiche un fil d\'ariane dans lequel chaque élément de navigation est représenté par une flèche avec son titre et lien.</Description><Description language-id=\"en_US\">Displays a breadcrumb in which every navigation element is represented by an arrow with its title and link.</Description></root>','display',NULL,'ftl','<#if entries?has_content>\n	<@liferay_util[\"html-top\"]>\n		<style>\n			.breadcrumb-arrows li {\n				background-color: #EFEFEF;\n				margin-bottom: 3px;\n				overflow: visible;\n			}\n\n			.breadcrumb-arrows li + li::before {\n				content: none;\n			}\n\n			.breadcrumb-arrows li > a {\n				border-right: 4px solid #FFF;\n				display: block;\n				max-width: 100%;\n				position: relative;\n			}\n\n			.breadcrumb-arrows .entry {\n				line-height: 40px;\n				overflow: hidden;\n				padding-left: 30px;\n				padding-right: 7px;\n				text-overflow: ellipsis;\n				white-space: nowrap;\n			}\n\n			.breadcrumb-arrows a::after {\n				border-bottom: 20px inset transparent;\n				border-left: 20px solid #EFEFEF;\n				border-top: 20px inset transparent;\n				content: \'\';\n				height: 0;\n				position: absolute;\n				right: -20px;\n				top: 0;\n				width: 0;\n				z-index: 2;\n			}\n\n			.breadcrumb-arrows li:nth-child(n+2) a::before {\n				border-bottom: 20px inset transparent;\n				border-left: 20px solid #FFF;\n				border-top: 20px inset transparent;\n				content: \'\';\n				height: 0;\n				left: 0;\n				position: absolute;\n				top: 0;\n				width: 0;\n			}\n\n			.breadcrumb-arrows li:last-child {\n				border-bottom-right-radius: 4px;\n				border-right-width: 0;\n				border-top-right-radius: 4px;\n				position: relative;\n			}\n\n			.breadcrumb-arrows li:last-child::before {\n				border-bottom: 20px inset transparent;\n				border-left: 20px solid #FFF;\n				border-top: 20px inset transparent;\n				content: \'\';\n				height: 0;\n				left: 0;\n				position: absolute;\n				top: 0;\n				width: 0;\n			}\n\n			.breadcrumb-arrows li:last-child .entry {\n				padding-right: 23px;\n			}\n\n			.breadcrumb-arrows li:first-child {\n				border-bottom-left-radius: 4px;\n				border-top-left-radius: 4px;\n			}\n\n			.breadcrumb-arrows li:first-child::before {\n				border-left-width: 0;\n			}\n\n			.breadcrumb-arrows li:first-child .entry {\n				padding-left: 23px;\n			}\n\n			.breadcrumb-arrows .active {\n				background-color: #007ACC;\n			}\n\n			.breadcrumb-arrows .active a, .breadcrumb-arrows .active .entry {\n				color: #FFF;\n			}\n\n			.breadcrumb-arrows .active a::after {\n				border-left-color: #007ACC;\n			}\n\n			.portlet-barebone .breadcrumb-arrows li > a, .portlet-borderless .breadcrumb-arrows li > a, .taglib-portlet-preview .breadcrumb-arrows li > a {\n				border-right-color: #F5F7F8;\n			}\n\n			.portlet-barebone .breadcrumb-arrows li:last-child::before, .portlet-barebone .breadcrumb-arrows li:nth-child(n+2) a::before, .portlet-borderless .breadcrumb-arrows li:last-child::before, .portlet-borderless .breadcrumb-arrows li:nth-child(n+2) a::before, .taglib-portlet-preview .breadcrumb-arrows li:last-child::before, .taglib-portlet-preview .breadcrumb-arrows li:nth-child(n+2) a::before {\n				border-left-color: #F5F7F8;\n			}\n		</style>\n	</@>\n\n	<div class=\"breadcrumb breadcrumb-arrows\">\n		<#assign cssClass = \"\" />\n\n		<#list entries as entry>\n			<#if entry?is_last>\n				<#assign cssClass = \"active\" />\n			</#if>\n\n			<li class=\"${cssClass}\">\n				<#if entry?has_next>\n					<a\n\n					<#if entry.isBrowsable()>\n						href=\"${entry.getURL()!\"\"}\"\n					</#if>\n\n					>\n				</#if>\n\n				<div class=\"entry\">\n					${htmlUtil.escape(entry.getTitle())}\n				</div>\n\n				<#if entry?has_next>\n					</a>\n				</#if>\n			</li>\n		</#list>\n	</div>\n</#if>',0,0,32113,NULL,NULL),('d2425092-bdc4-8e47-9f76-dc5ee0997689',32115,20152,20116,20120,NULL,20120,NULL,'2018-04-02 18:23:59.336000','2018-04-02 18:23:59.336000',32110,0,32111,'BREADCRUMB-HORIZONTAL-FTL','1.0','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,zh_CN,es_ES,ja_JP,nl_NL,hu_HU,pt_BR,de_DE,iw_IL,fi_FI,ca_ES,fr_FR,\" default-locale=\"en_US\"><Name language-id=\"zh_CN\">横向</Name><Name language-id=\"es_ES\">Horizontal</Name><Name language-id=\"ja_JP\">水平方向</Name><Name language-id=\"nl_NL\">Horizontaal</Name><Name language-id=\"hu_HU\">Vízszintes</Name><Name language-id=\"pt_BR\">Horizontal</Name><Name language-id=\"de_DE\">Horizontal</Name><Name language-id=\"iw_IL\">אופקי</Name><Name language-id=\"fi_FI\">Vaakasuoraan</Name><Name language-id=\"ca_ES\">Horizontal</Name><Name language-id=\"fr_FR\">Horizontal</Name><Name language-id=\"en_US\">Horizontal</Name></root>','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,zh_CN,es_ES,ja_JP,nl_NL,hu_HU,pt_BR,de_DE,iw_IL,fi_FI,ca_ES,fr_FR,\" default-locale=\"en_US\"><Description language-id=\"zh_CN\">横向显示一个路径导航。</Description><Description language-id=\"es_ES\">Muestra un camino de navegación horizontalmente.</Description><Description language-id=\"ja_JP\">ぱんくずリストを水平方向に表示する</Description><Description language-id=\"nl_NL\">Toont een klikpad horizontaal.</Description><Description language-id=\"hu_HU\">Egy útvonalat jelenít meg vízszintesen.</Description><Description language-id=\"pt_BR\">Exibir o caminho de navegação horizontalmente.</Description><Description language-id=\"de_DE\">Breadcrumbnavigation horizontal anzeigen</Description><Description language-id=\"iw_IL\">מציג פירור לחם אופקית</Description><Description language-id=\"fi_FI\">