 \"\"\n					/>\n\n					<#if showChildren>\n						<#assign nav_item_attr_has_popup = \"aria-haspopup=\'true\'\" />\n						<#assign nav_item_caret = \'<span class=\"lfr-nav-child-toggle\"><i class=\"icon-caret-down\"></i></span>\' />\n						<#assign\n							nav_item_css_class = \"${nav_item_css_class} dropdown\"\n							nav_item_link_css_class = \"dropdown-toggle\"\n						/>\n					</#if>\n\n					<#if navItem.isBrowsable()>\n						<#assign nav_item_href_link = \"href=\'${navItem.getURL()}\'\" />\n					</#if>\n\n					<#if navItem.isSelected()>\n						<#assign\n							nav_item_attr_selected = \"aria-selected=\'true\'\"\n							nav_item_css_class = \"${nav_item_css_class} selected active\"\n						/>\n					</#if>\n\n					<li class=\"${nav_item_css_class}\" id=\"layout_${navItem.getLayoutId()}\" ${nav_item_attr_selected} role=\"presentation\">\n						<a aria-labelledby=\"layout_${navItem.getLayoutId()}\" ${nav_item_attr_has_popup} class=\"${nav_item_link_css_class}\" ${nav_item_href_link} ${navItem.getTarget()} role=\"menuitem\">\n							<span><@liferay_theme[\"layout-icon\"] layout=navItem.getLayout() /> ${navItem.getName()} ${nav_item_caret}</span>\n						</a>\n\n						<#if showChildren>\n							<ul aria-expanded=\"false\" class=\"child-menu dropdown-menu\" role=\"menu\">\n								<#list navItem.getBrowsableChildren() as childNavigationItem>\n									<#assign\n										nav_child_attr_selected = \"\"\n										nav_child_css_class = \"\"\n									/>\n\n									<#if childNavigationItem.isSelected()>\n										<#assign\n											nav_child_attr_selected = \"aria-selected=\'true\'\"\n											nav_child_css_class = \"active selected\"\n										/>\n									</#if>\n\n									<li class=\"${nav_child_css_class}\" id=\"layout_${childNavigationItem.getLayoutId()}\" ${nav_child_attr_selected} role=\"presentation\">\n										<a aria-labelledby=\"layout_${childNavigationItem.getLayoutId()}\" href=\"${childNavigationItem.getURL()}\" ${childNavigationItem.getTarget()} role=\"menuitem\">${childNavigationItem.getName()}</a>\n									</li>\n								</#list>\n							</ul>\n						</#if>\n					</li>\n				</#if>\n			</#list>\n		</ul>\n	</div>\n\n	<@liferay_aui.script use=\"liferay-navigation-interaction\">\n		var navigation = A.one(\'#${navbarId}\');\n\n		Liferay.Data.NAV_INTERACTION_LIST_SELECTOR = \'.navbar-site\';\n		Liferay.Data.NAV_LIST_SELECTOR = \'.navbar-site\';\n\n		if (navigation) {\n			navigation.plug(Liferay.NavigationInteraction);\n		}\n	</@>\n</#if>',0,0,32157,NULL,NULL),('e8360b39-fcf3-6bf2-de5c-e9395d33ed15',32159,20152,20116,20120,NULL,20120,NULL,'2018-04-02 18:23:59.680000','2018-04-02 18:23:59.680000',20168,0,32111,'NAVIGATION-MACRO-FTL','1.0','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,zh_CN,es_ES,ja_JP,nl_NL,hu_HU,pt_BR,de_DE,iw_IL,fi_FI,ca_ES,fr_FR,\" default-locale=\"en_US\"><Name language-id=\"zh_CN\">导航菜单宏</Name><Name language-id=\"es_ES\">Navigation common macros</Name><Name language-id=\"ja_JP\">ナビゲーション共通マクロ</Name><Name language-id=\"nl_NL\">Navigation common macros</Name><Name language-id=\"hu_HU\">Navigation common macros</Name><Name language-id=\"pt_BR\">Macro do Menu de Navegação</Name><Name language-id=\"de_DE\">Navigation, geläufige Makros</Name><Name language-id=\"iw_IL\">Navigation common macros</Name><Name language-id=\"fi_FI\">Navigation common macros</Name><Name language-id=\"ca_ES\">Macros de navegació comuns</Name><Name language-id=\"fr_FR\">Macro de menu de navigation</Name><Name language-id=\"en_US\">Navigation common macros</Name></root>','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,zh_CN,es_ES,ja_JP,nl_NL,hu_HU,pt_BR,de_DE,iw_IL,fi_FI,ca_ES,fr_FR,\" default-locale=\"en_US\"><Description language-id=\"zh_CN\">包含用于导航菜单模板的常见宏。</Description><Description language-id=\"es_ES\">Contiene macros comunes para las plantillas de menús de navegación.</Description><Description language-id=\"ja_JP\">共通マクロをナビゲーションメニュー・テンプレートに含む</Description><Description language-id=\"nl_NL\">Bevat veelvoorkomende macro\'s voor navigatiemenu-sjablonen.</Description><Description language-id=\"hu_HU\">Általános makrókat tartalmaz a navigációs menü sablonokhoz.</Description><Description language-id=\"pt_BR\">Contém macros comuns para modelos de menus de navegação.</Description><Description language-id=\"de_DE\">Enthält geläufig Makros für Navigationsmenü-Vorlagen.</Description><Description language-id=\"iw_IL\">מכיל פונקציות מאקרו משותפות עבור תבניות תפריט ניווט</Description><Description language-id=\"fi_FI\">Sisältää yleisiä makroja navigaatiovalikon esitysmalleihin.</Description><Description language-id=\"ca_ES\">Conté macros comuns per a les plantilles de menú de navegació.</Description><Description language-id=\"fr_FR\">Contient les macros communs pour les gabarits de menu de navigation.</Description><Description language-id=\"en_US\">Contains common macros for navigation menu templates.</Description></root>','macro',NULL,'ftl','<#macro buildNavigation\n	branchNavItems\n	cssClass\n	displayDepth\n	includeAllChildNavItems\n	navItemLevel\n	navItems\n>\n	<#if navItems?has_content && ((displayDepth == 0) || (navItemLevel <= displayDepth))>\n		<ul class=\"${cssClass} level-${navItemLevel}\">\n			<#list navItems as navItem>\n				<#assign\n					nav_item_attr_selected = \"\"\n					nav_item_css_class = \"lfr-nav-item\"\n				/>\n\n				<#if includeAllChildNavItems || navItem.isInNavigation(branchNavItems)>\n					<#assign nav_item_css_class = \"${nav_item_css_class} open\" />\n				</#if>\n\n				<#if navItem.isSelected()>\n					<#assign\n						nav_item_attr_selected = \"aria-selected=\'true\'\"\n						nav_item_css_class = \"${nav_item_css_class} selected active\"\n					/>\n				</#if>\n\n				<li class=\"${nav_item_css_class}\" ${nav_item_attr_selected}>\n					<#if navItem.isBrowsable()>\n						<a class=\"${nav_item_css_class}\" href=\"${navItem.getRegularURL()!\"\"}\" ${navItem.getTarget()}>${navItem.getName()}</a>\n					<#else>\n						${navItem.getName()}\n					</#if>\n\n					<#if includeAllChildNavItems || navItem.isInNavigation(branchNavItems)>\n						<@buildNavigation\n							branchNavItems=branchNavItems\n							cssClass=cssClass\n							displayDepth=displayDepth\n							includeAllChildNavItems=includeAllChildNavItems\n							navItemLevel=(navItemLevel + 1)\n							navItems=navItem.getChildren()\n						/>\n					</#if>\n				</li>\n			</#list>\n		</ul>\n	</#if>\n</#macro>',0,0,32160,NULL,NULL),('92ca7427-7836-e45e-edaa-e5efbcca9587',32162,20152,20116,20120,NULL,20120,NULL,'2018-04-02 18:23:59.696000','2018-04-02 18:23:59.696000',20168,0,32111,'SPLIT-BUTTON-DROPDOWNS-FTL','1.0','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,zh_CN,es_ES,ja_JP,nl_NL,hu_HU,pt_BR,de_DE,iw_IL,fi_FI,ca_ES,fr_FR,\" default-locale=\"en_US\"><Name language-id=\"zh_CN\">拆分下拉菜单按钮</Name><Name language-id=\"es_ES\">Botón de división de menús desplegables</Name><Name language-id=\"ja_JP\">分割ボタンドロップダウン</Name><Name language-id=\"nl_NL\">Split Button Dropdowns</Name><Name language-id=\"hu_HU\">Osztó gomb legördülők</Name><Name language-id=\"pt_BR\">Botões Suspensos Separados</Name><Name language-id=\"de_DE\">Split-Button-Dropdowns</Name><Name language-id=\"iw_IL\">תיבות נפתחות עם כפתור מפוצל</Name><Name language-id=\"fi_FI\">Jaettu pudotuslistanappi</Name><Name language-id=\"ca_ES\">Menús desplegables amb botó de divisió</Name><Name language-id=\"fr_FR\">Bouton séparer de listes déroulantes</Name><Name language-id=\"en_US\">Split Button Dropdowns</Name></root>','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,zh_CN,es_ES,ja_JP,nl_NL,hu_HU,pt_BR,de_DE,iw_IL,fi_FI,ca_ES,fr_FR,\" default-locale=\"en_US\"><Description language-id=\"zh_CN\">显示有Bootstrap按钮的下拉式导航菜单。</Description><Description language-id=\"es_ES\">Displays a dropdown navigation menu with root menu items shown as buttons.</Description><Description language-id=\"ja_JP\">ルートメニューの内容をボタンとして、ドロップダウン・ナビゲーションメニューを表示する。</Description><Description language-id=\"nl_NL\">Displays a dropdown navigation menu with root menu items shown as buttons.</Description><Description language-id=\"hu_HU\">Megjelenít egy legördülő navigációs menüt Bootstrap gombokkal.</Description><Description language-id=\"pt_BR\">Exibir um menu de navegação dropdown com botões do Bootstrap.</Description><Description language-id=\"de_DE\">Zeigt ein Dropdown-Navigationsmenü, wobei die Wurzelelemente als Schaltflächen dargestellt werden.</Description><Description language-id=\"iw_IL\">Displays a dropdown navigation menu with root menu items shown as buttons.</Description><Description language-id=\"fi_FI\">Displays a dropdown navigation menu with root menu items shown as buttons.</Description><Description language-id=\"ca_ES\">Mostra un menú de navegació desplegable amb els elements del menú arrel que es mostren com a botons.</Description><Description language-id=\"fr_FR\">Displays a dropdown navigation menu with root menu items shown as buttons.</Description><Description language-id=\"en_US\">Displays a dropdown navigation menu with root menu items shown as buttons.</Description></root>','display',NULL,'ftl','<#if !entries?has_content>\n	<#if preview>\n		<div class=\"alert alert-info\">\n			<@liferay.language key=\"there-are-no-pages-to-display-for-the-current-page-level\" />\n		</div>\n	</#if>\n<#else>\n	<#assign\n		portletDisplay = themeDisplay.getPortletDisplay()\n\n		navbarId = \"navbar_\" + portletDisplay.getId()\n	/>\n\n	<div id=\"${navbarId}\">\n		<ul class=\"navbar-site split-button-dropdowns\">\n			<#assign navItems = entries />\n\n			<#list navItems as navItem>\n				<#assign showChildren = (displayDepth != 1) && navItem.hasBrowsableChildren() />\n\n				<#if navItem.isBrowsable() || showChildren>\n					<#assign\n						nav_item_caret = \"\"\n						nav_item_css_class = \"\"\n						nav_item_href_link = \"\"\n					/>\n\n					<#if navItem.isSelected()>\n						<#assign nav_item_css_class = \"active\" />\n					</#if>\n\n					<#if