ationInteraction);\n		}\n	</@>\n</#if>',0,0,32163,NULL,NULL),('f387803f-ac1e-167c-e91b-f79832f988c1',32165,20152,20116,20120,NULL,20120,NULL,'2018-04-02 18:23:59.717000','2018-04-02 18:23:59.717000',20008,0,32111,'ASSET-TAGS-NAVIGATION-COLOR-BY-POPULARITY-FTL','1.0','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,zh_CN,es_ES,ja_JP,nl_NL,hu_HU,pt_BR,de_DE,iw_IL,fi_FI,ca_ES,fr_FR,\" default-locale=\"en_US\"><Name language-id=\"zh_CN\">受欢迎的颜色</Name><Name language-id=\"es_ES\">Color por popularidad</Name><Name language-id=\"ja_JP\">頻出度により色分けする</Name><Name language-id=\"nl_NL\">Kleur op populariteit</Name><Name language-id=\"hu_HU\">Szín népszerűség alapján</Name><Name language-id=\"pt_BR\">Colorir por Popularidade</Name><Name language-id=\"de_DE\">Nach Popularität färben</Name><Name language-id=\"iw_IL\">צבע בהתאם לפופולריות</Name><Name language-id=\"fi_FI\">Väri suosion mukaan</Name><Name language-id=\"ca_ES\">Color per popularitat</Name><Name language-id=\"fr_FR\">Couleur par popularité</Name><Name language-id=\"en_US\">Color by Popularity</Name></root>','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,zh_CN,es_ES,ja_JP,nl_NL,hu_HU,pt_BR,de_DE,iw_IL,fi_FI,ca_ES,fr_FR,\" default-locale=\"en_US\"><Description language-id=\"zh_CN\">显示资源标签颜色等级： 红色 (高), 黄色 (中), 绿色 (低).</Description><Description language-id=\"es_ES\">Muestra las etiquetas de contenido coloreadas según su popularidad : rojo (alta), amarilla (media) y verde (baja).</Description><Description language-id=\"ja_JP\">アセットタグを人気順に表示する:赤(高い)、黄色（普通)、緑（低い）</Description><Description language-id=\"nl_NL\">Toon content labels volgens populariteit: rood (hoog), geel (midden) en groen (laag).</Description><Description language-id=\"hu_HU\">Megjeleníti a tartalom címkéket népszerűség szerint színezve: vörös (magas), sárga (közepes), és zöld (alacsony).</Description><Description language-id=\"pt_BR\">Exibe as tags coloridas por popularidade: vermelho (alta), amarelo (média) e verde (baixa).</Description><Description language-id=\"de_DE\">Schlagwörter nach Popularität färben: Rot (hoch), gelb (mittel), grün (niedrig).</Description><Description language-id=\"iw_IL\">מציג את תגיות הנכסים על פי מידת הפופולריות שלהם: אדום (גבוהה), צהוב (בינונית) וירוק (נמוכה).</Description><Description language-id=\"fi_FI\">Näyttää sisältötageja, mitkä on väritetty suosion mukaan: punainen (korkea), keltainen (keskiverto) ja virheä (alhainen)</Description><Description language-id=\"ca_ES\">Mostra les etiquetes per colors segons popularitat: vermell (alta), groga (mitjana) i verda (baixa).</Description><Description language-id=\"fr_FR\">Affiche les étiquettes d\'asset coloriées par popularité: rouge (élevé), jaune (moyen), et vert (bas).</Description><Description language-id=\"en_US\">Displays asset tags colored by popularity: red (high), yellow (medium), and green (low).</Description></root>','display',NULL,'ftl','<#if entries?has_content>\n	<ul class=\"tag-items tag-list\">\n		<#assign\n			scopeGroupId = getterUtil.getLong(scopeGroupId, themeDisplay.getScopeGroupId())\n			classNameId = getterUtil.getLong(classNameId, 0)\n\n			maxCount = 1\n			minCount = 1\n		/>\n\n		<#list entries as entry>\n			<#assign\n				maxCount = liferay.max(maxCount, entry.getAssetCount())\n				minCount = liferay.min(minCount, entry.getAssetCount())\n			/>\n		</#list>\n\n		<#assign multiplier = 1 />\n\n		<#if maxCount != minCount>\n			<#assign multiplier = 3 / (maxCount - minCount) />\n		</#if>\n\n		<#list entries as entry>\n			<li class=\"taglib-asset-tags-summary\">\n				<#assign popularity = (maxCount - (maxCount - (entry.getAssetCount() - minCount))) * multiplier />\n\n				<#if popularity < 1>\n					<#assign color = \"green\" />\n				<#elseif (popularity >= 1) && (popularity < 2)>\n					<#assign color = \"orange\" />\n				<#else>\n					<#assign color = \"red\" />\n				</#if>\n\n				<#assign tagURL = renderResponse.createRenderURL() />\n\n				${tagURL.setParameter(\"resetCur\", \"true\")}\n				${tagURL.setParameter(\"tag\", entry.getName())}\n\n				<a class =\"tag\" style=\"color: ${color};\" href=\"${tagURL}\">\n					${entry.getName()}\n\n					<#if entry.getAssetCount()?? && getterUtil.getBoolean(showAssetCount)>\n						<span class=\"tag-asset-count\">(${entry.getAssetCount()})</span>\n					</#if>\n				</a>\n			</li>\n		</#list>\n	</ul>\n\n	<br style=\"clear: both;\" />\n</#if>',0,0,32166,NULL,NULL),('f7949e5c-e0ed-9c30-781b-862dd978fb49',32168,20152,20116,20120,NULL,20120,NULL,'2018-04-02 18:23:59.745000','2018-04-02 18:23:59.745000',20052,0,32111,'SITE-MAP-MULTI-COLUMN-LAYOUT-FTL','1.0','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,zh_CN,es_ES,ja_JP,nl_NL,hu_HU,pt_BR,de_DE,iw_IL,fi_FI,ca_ES,fr_FR,\" default-locale=\"en_US\"><Name language-id=\"zh_CN\">多列布局</Name><Name language-id=\"es_ES\">Diseño con varias columnas</Name><Name language-id=\"ja_JP\">複数カラムレイアウト</Name><Name language-id=\"nl_NL\">Lay-out met meerdere kolommen</Name><Name language-id=\"hu_HU\">Több oszlopos elrendezés</Name><Name language-id=\"pt_BR\">Layout em Múltiplas Colunas</Name><Name language-id=\"de_DE\">Multi-Spalten-Layout</Name><Name language-id=\"iw_IL\">תצורה מרובת עמודות</Name><Name language-id=\"fi_FI\">Usean sarakkeen asettelu</Name><Name language-id=\"ca_ES\">Plana multi-columna</Name><Name language-id=\"fr_FR\">Mise en page multi-colonne</Name><Name language-id=\"en_US\">Multi Column Layout</Name></root>','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,zh_CN,es_ES,ja_JP,nl_NL,hu_HU,pt_BR,de_DE,iw_IL,fi_FI,ca_ES,fr_FR,\" default-locale=\"en_US\"><Description language-id=\"zh_CN\">为每一个顶层页面显示一列，每一列都包含一个顶层页面的名称，顶层页面下面列出其直接子页面。</Description><Description language-id=\"es_ES\">Muestra una columna por cada página primaria. Cada columna contiene el nombre de una página primaria con las subordinadas inmediatas de esta página listadas debajo de ella.</Description><Description language-id=\"ja_JP\">最上位ページの列を表示する。それぞれの列には最上位ページの名前が、直下のサブページ名と共に表示されます</Description><Description language-id=\"nl_NL\">Toon een kolom voor elke top level pagina. Elke kolom bevat de naam van een top level pagina met de directe onderliggende pagina\'s eronder.</Description><Description language-id=\"hu_HU\">Megjelenít egy oszlopot minden felső szintű oldal számára. Minden oszlop tartalmazza a felső szintű oldal nevét, alatta a felső szintű oldal gyerekével.</Description><Description language-id=\"pt_BR\">Exibe uma coluna para cada página primária. Cada coluna contém o nome de uma página primária com as subordinadas imediatas desta página listadas abaixo dela.</Description><Description language-id=\"de_DE\">Zeigt eine Spalte für jede Seite der obersten Ebene an. Jede Spalte enthält den Namen der Seite der obersten Ebene sowie die Seiten der direkt untergeordneten Ebene.</Description><Description language-id=\"iw_IL\">מציג עמודה עבור כל דף מרמה עליונה. כל עמודה כוללת את שם דף הרמה העליונה ותחתיו ההבנים המיידיים שלו.</Description><Description language-id=\"fi_FI\">Näyttää sarakkeen jokaisella ylätason sivulla. Jokainen sarake sisältää nimen ja ylätason sivun, missä alisivut on listattu alla.</Description><Description language-id=\"ca_ES\">Mostra una columna per a cada pàgina de nivell superior. Cada columna inclou el nom d\'una pàgina de nivell superior amb pàgines fill immediates indicades a sota.</Description><Description language-id=\"fr_FR\">Affiche une colonne pour chaque page du niveau racine. Chaque colonne inclut le nom d\'une page du niveau racine avec ses pages enfants listées en dessous.</Description><Description language-id=\"en_US\">Displays a column for each top level page. Each column includes the name of a top level page with the page\'s immediate children listed underneath.</Description></root>','display',NULL,'ftl','<#if entries?has_content>\n	<@liferay_aui.row>\n		<#list entries as entry>\n			<@liferay_aui.col width=25>\n				<div class=\"results-header\">\n					<h3>\n						<a\n\n						<#assign layoutType = entry.getLayoutType() />\n\n						<#if layoutType.isBrowsable()>\n							href=\"${portalUtil.getLayoutURL(entry, themeDisplay)}\"\n						</#if>\n\n						>${entry.getName(locale)}</a>\n					</h3>\n				</div>\n\n				<@displayPages pages=entry.getChildren() />\n			</@liferay_aui.col>\n		</#list>\n	</@liferay_aui.row>\n</#if>\n\n<#macro displayPages\n	pages\n>\n	<#if pages?has_content>\n		<ul class=\"child-pages\">\n			<#list pages as page>\n				<li>\n					<a\n\n					<#assign pageType = page.getLayoutType() />\n\n					<#if pageType.isBrowsable()>\n						href=\"${portalUtil.getLayoutURL(page, themeDisplay)}\"\n					</#if>\n\n					>${page.getName(locale)}</a>\n\n					<@displayPages pages=page.getChildren() />\n				</li>\n			</#list>\n		</ul>\n	</#if>\n</#macro>',0,0,32169,NULL,NULL),('cbd0392c-4b3d-0596-fc16-8fc6f4585183',32172,20152,20116,20120,NULL,20120,NULL,'2018-04-02 18:23:59.770000','2018-04-02 18:23:59.770000',32171,0,32111,'LANGUAGE-ICON-FTL','1.0','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,zh_CN,es_ES,ja_JP,nl_NL,hu_HU,pt_BR,de_DE,iw_IL,fi_FI,ca_ES,fr_FR,\" default-locale=\"en_US\"><Name language-id=\"zh_CN\">图标</Name><Name language-id=\"es_ES\">Icono</Name><Name language-id=\"ja_JP\">アイコン</Name><Name language-id=\"nl_NL\">Pictogram</Name><Name language-id=\"hu_HU\">Ikon</Name><Name language-id=\"pt_BR\">Ícone</Name><Name language-id=\"de_DE\">Symbol</Name><Name language-id=\"iw_IL\">סמל</Name><Name language-id=\"fi_FI\">Ikoni</Name><Name language-id=\"ca_ES\">Icona</Name><Name language-id=\"fr_FR\">Icône</Name><Name language-id=\"en_US\">Icon</Name></root>','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,zh_CN,es_ES,ja_JP,nl_NL,hu_HU,pt_BR,de_DE,iw_IL,fi_FI,ca_ES,fr_FR,\" default-locale=\"en_US\"><Description language-id=\"zh_CN\">显示与每种语言相关标志的图标。</Description><Description language-id=\"es_ES\">Muestra el icono de la bandera asociada a cada idioma</Description><Description languag