INSERT INTO `LayoutPrototype` VALUES (0,'35a2ff5e-c335-6b93-789e-2c13e92b35b1',36181,20116,20120,NULL,'2018-04-02 18:24:54.063000','2018-04-02 18:24:54.063000','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,zh_CN,es_ES,ja_JP,nl_NL,hu_HU,pt_BR,de_DE,iw_IL,fi_FI,ca_ES,fr_FR,\" default-locale=\"en_US\"><Name language-id=\"zh_CN\">选择显示页面</Name><Name language-id=\"es_ES\">Seleccione una página de visualización</Name><Name language-id=\"ja_JP\">コンテンツディスプレイページ</Name><Name language-id=\"nl_NL\">Kies een weergavepagina</Name><Name language-id=\"hu_HU\">Tartalom megjelenítő olda</Name><Name language-id=\"pt_BR\">Página de Exibição de Conteúdo</Name><Name language-id=\"de_DE\">Anzeigeseite auswählen</Name><Name language-id=\"iw_IL\">בחר דף תצוגה</Name><Name language-id=\"fi_FI\">Web-sisälllön esityssivu</Name><Name language-id=\"ca_ES\">Escolliu una pàgina de presentació</Name><Name language-id=\"fr_FR\">Choisir une page d\'affichage</Name><Name language-id=\"en_US\">Content Display Page</Name></root>','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,zh_CN,es_ES,ja_JP,nl_NL,hu_HU,pt_BR,de_DE,iw_IL,fi_FI,ca_ES,fr_FR,\" default-locale=\"en_US\"><Description language-id=\"zh_CN\">在此页创建、编辑和浏览网页内容。搜索可用的内容、探索带有标签的相关内容，并浏览内容类别。</Description><Description language-id=\"es_ES\">Cree, edite y explore contenidos web de esta página. Busque contenido adicional, explore contenido relacionado con etiquetas y hojee las categorías del contenido.</Description><Description language-id=\"ja_JP\">このページからWebコンテンツの作成、編集ができます。コンテンツの検索、タグを利用した関連するコンテンツの検索と、コンテンツのカテゴリを閲覧できます</Description><Description language-id=\"nl_NL\">U kunt vanaf deze pagina webinhoud aanmaken, bewerken en ontdekken. Zoek beschikbare inhoud, ontdek gerelateerde inhoud met tag en blader door inhoudscategorieën.</Description><Description language-id=\"hu_HU\">Hozzon létre, szerkesszen és fedezzen fel webes tartalmat erről az oldalról. Keressen elérhető tartalmat, fedezze fel a kapcsolódó tartalmat címkékkel és böngésszen tartalomkategóriákat.</Description><Description language-id=\"pt_BR\">Crie, edite e explore conteúdo web a partir desta página. Pesquise conteúdo disponível, explore o conteúdo relacionado com tags e navegue as categorias de conteúdo.</Description><Description language-id=\"de_DE\">Erstellen, bearbeiten und finden von Webcontent dieser Seite. Durchsuchen Sie verfügbare Inhalte, erkunden Sie ähnliche Inhalte über Schlagwörter und durchsuchen Sie Kategorien.</Description><Description language-id=\"iw_IL\">צור, ערוך וחקור תוכן רשת מעמוד זה. חפש תוכן זמין, חקור תוכן קשור עם תגיות ודפדף בין קטגוריות התוכן.</Description><Description language-id=\"fi_FI\">Luo, muokkaa ja tutustu web-sisältöön tältä sivulta. Hae saatavilla olevaa sisältöä, tutustu aiheeseen liittyvään sisältöön tunnisteilla ja selaa sisältöluokkia.</Description><Description language-id=\"ca_ES\">Crear, editar, i explorar el contingut web des d\'aquesta pàgina. Cercar contingut disponible, explorar contingut relacionat amb les etiquetes i navegar per les categories de contingut.</Description><Description language-id=\"fr_FR\">Créer, éditer et explorer le contenu web de cette page. Rechercher un contenu disponible, explorer le contenu à l\'aide des tags et parcourir les catégories du contenu.</Description><Description language-id=\"en_US\">Create, edit, and explore web content from this page. Search available content, explore related content with tags, and browse content categories.</Description></root>',NULL,1),(0,'de10e29b-78e0-efdd-b906-5d4a743b8fc2',36254,20116,20120,NULL,'2018-04-02 18:25:08.950000','2018-04-02 18:25:08.950000','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,zh_CN,es_ES,ja_JP,nl_NL,hu_HU,pt_BR,de_DE,iw_IL,fi_FI,ca_ES,fr_FR,\" default-locale=\"en_US\"><Name language-id=\"zh_CN\">Wiki</Name><Name language-id=\"es_ES\">Wiki</Name><Name language-id=\"ja_JP\">ウィキ</Name><Name language-id=\"nl_NL\">Wiki</Name><Name language-id=\"hu_HU\">Wiki</Name><Name language-id=\"pt_BR\">Wiki</Name><Name language-id=\"de_DE\">Wiki</Name><Name language-id=\"iw_IL\">ויקי</Name><Name language-id=\"fi_FI\">Wiki</Name><Name language-id=\"ca_ES\">Wiki</Name><Name language-id=\"fr_FR\">Wiki</Name><Name language-id=\"en_US\">Wiki</Name></root>','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,zh_CN,es_ES,ja_JP,nl_NL,hu_HU,pt_BR,de_DE,iw_IL,fi_FI,ca_ES,fr_FR,\" default-locale=\"en_US\"><Description language-id=\"zh_CN\">通过此页的Wiki与成员协作。通过标签搜索相关的内容，快速导航、轻松的类别。</Description><Description language-id=\"es_ES\">Colabora con los miembros a través de la wiki en esta página. Descubre el contenido relacionado a través de etiquetas y navega rápida y fácilmente por las categorías.</Description><Description language-id=\"ja_JP\">このページのウィキを通じてメンバーとコラボレーションできます。タグを利用して関連するコンテンツを見つけたり、カテゴリを使って簡単に情報をたどることができます</Description><Description language-id=\"nl_NL\">Werk samen met leden via de wiki op deze pagina. Ontdek verwante inhoud via tags en navigeer snel en eenvoudig met behulp van categorieën.</Description><Description language-id=\"hu_HU\">Működjön együtt a tagokkal az ezen az oldalon található wiki-n keresztül. Fedezzen fel kapcsolódó tartalmat címkékkel, és navigáljon gyorsan és könnyen kategóriákkal.</Description><Description language-id=\"pt_BR\">Colabore com os membros através do wiki nesta página. Descubra conteúdo relacionado através de etiquetas e navegue rápida e facilmente com as categorias.</Description><Description language-id=\"de_DE\">Arbeiten Sie mit Hilfe des Wikis dieser Seite mit anderen Mitgliedern zusammen. Entdecken Sie in Verbindung stehende Inhalte über Tags und navigieren Sie schnell und einfach mit Kategorien.</Description><Description language-id=\"iw_IL\">שתפו פעולה עם חברים באמצעות הוויקי בדף זה. גלו תוכן קשור באמצעות תגיות ונווטו מהר ובקלות בין קטגוריות.</Description><Description language-id=\"fi_FI\">Tee yhteistyötä jäsenten kanssa wikin kautta tällä sivulla. Tutustu aiheeseen liittyvään sisältöön tunnisteiden kautta ja siirry helposti ja nopeasti luokkien välillä.</Description><Description language-id=\"ca_ES\">Col·labora amb els membres a través de la wiki en aquesta pàgina. Descobreix el contingut relacionat a través d\'etiquetes i navega d\'una forma ràpida i fàcil amb les categories.</Description><Description language-id=\"fr_FR\">Collaborez avec les membres par le bias de wiki sur cette page. Découvrez le contenu lié par le biais des tags et naviguez rapidement et facilement avec les catégories.</Description><Description language-id=\"en_US\">Collaborate with members through the wiki on this page. Discover related content through tags, and navigate quickly and easily with categories.</Description></root>',NULL,1),(0,'50153887-05be-0142-561b-36c682fbf34c',36285,20116,20120,NULL,'2018-04-02 18:25:09.978000','2018-04-02 18:25:09.978000','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,zh_CN,es_ES,ja_JP,nl_NL,hu_HU,pt_BR,de_DE,iw_IL,fi_FI,ca_ES,fr_FR,\" default-locale=\"en_US\"><Name language-id=\"zh_CN\">博客</Name><Name language-id=\"es_ES\">Blog</Name><Name language-id=\"ja_JP\">ブログ</Name><Name language-id=\"nl_NL\">Blog</Name><Name language-id=\"hu_HU\">Blog</Name><Name language-id=\"pt_BR\">Blog</Name><Name language-id=\"de_DE\">Blog</Name><Name language-id=\"iw_IL\">בלוג</Name><Name language-id=\"fi_FI\">Blogit</Name><Name language-id=\"ca_ES\">Bloc</Name><Name language-id=\"fr_FR\">Blogue</Name><Name language-id=\"en_US\">Blog</Name></root>','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,zh_CN,es_ES,ja_JP,nl_NL,hu_HU,pt_BR,de_DE,iw_IL,fi_FI,ca_ES,fr_FR,\" default-locale=\"en_US\"><Description language-id=\"zh_CN\">在页面中创建，编辑并且预览博客。通便签导出主题，并也博客中的其他成员联系。</Description><Description language-id=\"es_ES\">Cree, edite y vea blogs desde esta página. Explore los temas usando etiquetas y conecte con otros miembros del blog.</Description><Description language-id=\"ja_JP\">このページからブログの作成、編集、閲覧ができます。タグを使用して記事を検索したり、ブログの他のメンバーを結びつけることができます。</Description><Description language-id=\"nl_NL\">Vanaf deze pagina kunt u blogs aanmaken, bewerken en bekijken. Ontdek onderwerpen aan de hand van tags, en verbind met andere leden die bloggen.</Description><Description language-id=\"hu_HU\">Hozz létre, szerkessz és tekints meg blogokat erről az oldalról. Fedetd fel a témákat a címkék segítségével és lépj kapcsolatba a többi blog taggal.</Description><Description language-id=\"pt_BR\">Crie, edite e visualize blogs a partir desta página. Explore tópicos utilizando tags e conecte-se a outros membros deste blog.</Description><Description language-id=\"de_DE\">Erstellen, bearbeiten und ansehen von Blogs dieser Seite. Erkunden Sie Themen mit Hilfe von Tags und verbinden Sie sich mit anderen Mitgliedern, die bloggen.</Description><Description language-id=\"iw_IL\">צור, ערוך וצפה בבלוגים מעמוד זה. חקור נושאים באמצעות תגיות והתחבר עם חברים אחרים שכותבים בלוגים.</Description><Description language-id=\"fi_FI\">Luo, muokkaa ja näytä tämän sivun blogit. Selaa aiheita käytämällä tunnisteita ja tutustu muihin tämän blogin kirjoittajiin.</Description><Description language-id=\"ca_ES\">Crear, editar i veure els blogs d\'aquesta pàgina. Explorar temes fent ús de les etiquetes i connectar-se amb altres membres d\'aquest blog.</Description><Description language-id=\"fr_FR\">Créer, éditer et visualiser les blogs de cette page. Explorer les sujets en utilisant des tags et se connecter à d\'autres membres de ce blog.</Description><Description language-id=\"en_US\">Create, edit, and view blogs from this page. Explore topics using tags, and connect with other members that blog.</Description></root>',NULL,1);
